import React from 'react';
import './Footer.css';
import logo from '../Assets/Logo.svg'

const Footer = () => {
    return (
        <div className='footer'>
            <div className="footer-logo">
                <img src={logo} alt="Footer logo"/>
            </div>
            <ul className="footer-links">
                <li>Products</li>
                <li>Search</li>
                <li>Cart</li>
                <li>Login</li>
                <li>Register</li>
            </ul>
        </div>
    )
}

export default Footer;
